import React, { useState } from "react";

 const App = () => {

  const [fname,setFname]= useState("");
  const [lname,setLname]= useState("");
  const [passwd,setPasswd]= useState("");
  const [data,setData] = useState([]);


    const onsubmit = (e) =>{
      e.preventDefault();
      const data = {firstName : fname , lastName : lname, Password : passwd}
      setData([data]);
    }
   return(
     <>
     <form onSubmit={onsubmit}>
      <div>
        <h2> Users Data:</h2>

        <input type="text" placeholder="Enter your first Name"  value={fname} onChange={(e)=>setFname(e.target.value)}/><br/><br/>
        <input type="text" placeholder="Enter your last Name"  value={lname} onChange={(e)=>setFname(e.target.value)}></input><br/><br/>
        <input type="password" placeholder="Enter Password" value={passwd}></input><br/><br/>
        <input type="submit" placeholder="submit" onClick={onsubmit}></input>
        <br/>
        </div>
        </form>


        {
        data.map((inputs)=>{
          return(
            <>
            <p>{inputs.fname}</p>
            <p>{inputs.lname}</p>
            <p>{inputs.passwd}</p>
            </>
          )
        })  
        }
     </>
   );
 }

 export default App
